(60421, '0770968B-F856-4272-A231-2D1FAAF11260', 'I want to share with you some music I‚Äôm wrestling with as an offering to you.  I don‚Äôt want to explain everything, as I think that can diminish the experience‚Ä¶.some of this is meant to be‚Ä¶.lyrical‚Ä¶not to be processed by the rational head. But the idea came from the Arthur Brooks book and his insights about the different ways west vs east look at art as a metaphor for leading your life. How in the west, we look at the ‚Äúblank canvas‚Äù and its about creating ourselves as the masterpiece, one brushstroke at a time. While to the Buddhist, it is like a sculpture from a block of jade‚Ä¶.where the ‚Äúart‚Äù already is there‚Ä¶it exists‚Ä¶but the artist needs to reveal the masterpiece by taking away the pieces of the block‚Ä¶that aren‚Äôt needed‚Ä¶.the are inessential and in the way of discovering the essence at the center‚Ä¶our job is to get rid of all the obstacles, all the pieces that are in the way of seeing. And this served for me as a double meaning‚Ä¶the idea of being blocked, of being a person in the past where me emotions couldn‚Äôt be seen, because I couldn‚Äôt allow myself access to reveal to myself and others what was beneath the block of jade‚Ä¶.my stone face.  And the rest‚Ä¶Im playing with the idea that our perceptions are our reality‚Ä¶but not reality‚Ä¶..the circus mirror you see, is not only your distortions of who I am, but my own distortions and things I obscure‚Ä¶because it is what we need at that moment. The lines about ‚Äúbrick facts and truths, scaring cats off the roofs‚Äù Brick facts are the kinds that to me are solid, irrefutable‚Ä¶and can be parts of walls, or thrown as weapons‚Ä¶.scaring cats off the roofs‚Ä¶..that‚Äôs the anger that comes for all the reason anger happens‚Ä¶.‚ÄùTell the boys, It‚Äôs all I knew‚Äù Can be taken in many ways‚Ä¶to me‚Ä¶.it was a reflection of myself in the past‚Ä¶.and how as a father‚Ä¶.I did my best‚Ä¶as the person I was at the time‚Ä¶.It‚Äôs all I knew (at the time).  And this is true‚Ä¶.and not an excuse‚Ä¶.it is an invitation for grace and kindness to one another‚Ä¶.we act on what we know to be true‚Ä¶.at the moment‚Ä¶and this knowledge, of ourselves, of the other person, of any ‚Äúreality‚Äù in a moment in time, is incomplete and obscured. We do our best. I‚Äôm doing my best. And with you, it‚Äôs with renewed focus and attention and love and play. Because I know how precious you are to me‚Ä¶.and I know I‚Äôve made big mistakes. And getting it right all the time isn‚Äôt possible‚Ä¶.for either of us.  It‚Äôs like (in the song) ‚Äúcatching the waves, with chopsticks and razorblades‚Äù. Impossible.   That‚Äôs Day 20', '690163315655999872', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-11-14T16:01:55.656000'),
